import React from 'react';
import CardColumns from 'react-bootstrap/CardColumns';


import Cards from './Cards';

class Main extends React.Component {

  clickMe = () => {
    this.props.showModalCard();
}
  render() {
    return (
      <CardColumns>
        <Cards elementData={this.props.mainData} showModal={this.props.showModal}/>
      </CardColumns>
    );
  }
}
export default Main;
